import React, { Component } from "react";
// import PropTypes from "prop-types";
import "./sticker.css";

const Sticker = props => {
  return (
    <div>
      <div className="sticker">
        <div className="target" onClick={props.placeSticker} />
        <div className="image">
          <img src={props.sticker.src} alt={props.sticker.alt} />
        </div>
      </div>
      <div className="finalSticker" />
    </div>
  );
};

export default Sticker;
